import { PropsWithChildren } from "react";
import { WorkExperience } from "./ResumeContents";

function formatDate(start: Date, end?: Date): string {
    const startDate = (start.getMonth() + 1).toString() + '/' + start.getFullYear().toString()
    let endDate = 'Present'
    if(end) {
        endDate = end.getMonth().toString().concat('/', end.getFullYear().toString())
    }
    return startDate.concat(' - ', endDate)
}

export function GridItem({children}: PropsWithChildren<{}>) {
    return (<div className='px-5 justify-center'>{children}</div>)
}

export function Title({children}: PropsWithChildren<{}>) {
    return (<h2 className='font-semibold text-left px-5 pt-3'>{children}</h2>)
}

export function RightItem({children}: PropsWithChildren<{}>) {
    return (<h2 className='font-normal text-right px-5 truncate pt-3'>{children}</h2>)
}

export function LeftItem({children}: PropsWithChildren<{}>) {
    return (<h2 className='font-normal text-left px-5'>{children}</h2>)
}

export function WorkExperienceItem({workExp}:{workExp: WorkExperience}): JSX.Element {
    return (<div className='bg-stone-800 text-slate-50 sm:mx-2 md:mx-10 mb-20 overflow-auto content-center hover:w-full'>
        <div className='grid grid-cols-2'>
            <Title>{workExp.name}</Title>
            <RightItem>{workExp.location}</RightItem>
        </div>
        <GridItem>{formatDate(workExp.startDate, workExp.endDate)}</GridItem>
    </div>)
}
